-- ----------------------------
-- View structure for InventoryListAllView
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[InventoryListAllView]') AND type IN ('V'))
	DROP VIEW [dbo].[InventoryListAllView]
GO

CREATE VIEW [dbo].[InventoryListAllView] AS SELECT
	ITEMNO,
	ITEMDESC,
	UNIT,
	SUM ( UNITCOST ) /
CASE
	WHEN COUNT ( CASE WHEN UNITCOST <> 0 THEN 1 ELSE NULL END ) = 0 THEN
	1 ELSE COUNT ( CASE WHEN UNITCOST <> 0 THEN 1 ELSE NULL END ) 
	END AS UNITCOST,
	UNITPRICE,
		SUM ( QTY ) AS QTY,
	BUYABLE,
	SELLABLE,
	INVENTORABLE,
	COSTOFSALESACC,
	INCOMEACC,
	ASSETACC
FROM
	(
	SELECT
		dbo.tblInvtry.ITEMNO,
		dbo.tblInvtry.ITEMDESC,
		dbo.tblInvtry.UNIT,
		dbo.tblInvtry.UNITCOST AS UNITCOST,
		0 AS QTY,
		dbo.tblInvtry.UNITPRICE ,
		buyable,
		sellable,
		INVENTORABLE,
		COSTOFSALESACC,
		INCOMEACC,
		ASSETACC,
		status 
	FROM
		dbo.tblInvtry UNION ALL
	SELECT
		dbo.tblInvtry.ITEMNO,
		dbo.tblInvtry.ITEMDESC,
		dbo.tblInvtry.UNIT,
		dbo.tblItemTransaction.UNITCOST AS UNITCOST,
		dbo.tblItemTransaction.QTY AS QTY,
		dbo.tblInvtry.UNITPRICE,
		buyable,
		sellable,
		INVENTORABLE,
		COSTOFSALESACC,
		INCOMEACC,
		ASSETACC,
		status 
	FROM
		dbo.tblInvtry
		INNER JOIN dbo.tblItemTransaction ON dbo.tblInvtry.ITEMNO = dbo.tblItemTransaction.itemNo 
	) AS SUBT 
GROUP BY
	ITEMNO,
	ITEMDESC,
	UNIT,
 UNITPRICE,
	BUYABLE,
	SELLABLE,
	INVENTORABLE,
	COSTOFSALESACC,
	INCOMEACC,
	ASSETACC
GO


-- ----------------------------
-- View structure for paymentsView
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[paymentsView]') AND type IN ('V'))
	DROP VIEW [dbo].[paymentsView]
GO

CREATE VIEW [dbo].[paymentsView] AS SELECT CARDID,
CARDNAME,
INVOICENO,
CASE WHEN sum(TOTALAMOUNT)- sum(AMOUNTPAID) <= 0 then 'CLOSE' ELSE 'OPEN' END AS STATUS,
[DATE],
SUM(TOTALAMOUNT) AS TOTALAMOUNT,
SUM(AMOUNTPAID) AS AMOUNTPAID
FROM(
SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName AS CARDNAME,
dbo.tblSalesInvoice.salesInvoiceNo AS INVOICENO,
convert(varchar, dbo.tblSalesInvoice.transDate, 101) AS [DATE],
dbo.tblSalesInvoice.totalAmount AS TOTALAMOUNT,
0 AMOUNTPAID
FROM
dbo.tblCardsProfile
INNER JOIN dbo.tblSalesInvoice ON dbo.tblCardsProfile.cardID = dbo.tblSalesInvoice.cardID
GROUP BY
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblSalesInvoice.salesInvoiceNo,
dbo.tblSalesInvoice.transDate,
dbo.tblSalesInvoice.totalAmount
UNION ALL
SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName AS CARDNAME,
dbo.tblSalesInvoice.salesInvoiceNo AS INVOICENO,
convert(varchar, dbo.tblSalesInvoice.transDate, 101) AS [DATE],
0 AS TOTALAMOUNT,
Sum(dbo.tblPaymentsReceived.amountApplied) AS AMOUNTPAID
FROM
dbo.tblCardsProfile
INNER JOIN dbo.tblSalesInvoice ON dbo.tblCardsProfile.cardID = dbo.tblSalesInvoice.cardID
INNER JOIN dbo.tblPaymentsReceived ON dbo.tblSalesInvoice.salesInvoiceNo = dbo.tblPaymentsReceived.invoiceNo
GROUP BY
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblSalesInvoice.salesInvoiceNo,
dbo.tblSalesInvoice.transDate,
dbo.tblSalesInvoice.totalAmount
) AS SUBT
GROUP BY
CARDID,CARDNAME,INVOICENO,[DATE]
GO


