	DROP PROCEDURE[dbo].[get_voucher_list]
GO

CREATE PROCEDURE [dbo].[get_voucher_list]
@status as varchar(255),
@searchValue as varchar(255)
AS
BEGIN
if @status = 'All' BEGIN
SELECT DISTINCT
convert(varchar,dbo.tblVoucher.[date],111) AS [Date],
dbo.tblVoucher.VoucherNo,
dbo.tblVoucher.cardID,
dbo.tblCardsProfile.cardName,
CONVERT(varchar, CAST(tblVoucher.AMOUNT AS money), 1) AS Amount,
dbo.tblVoucher.status
FROM
dbo.tblVoucher
INNER JOIN dbo.tblCardsProfile ON dbo.tblCardsProfile.cardID = dbo.tblVoucher.cardID
where [Date] like '%' + @searchValue + '%' or VoucherNo like '%' + @searchValue + '%' or tblVoucher.cardID like '%' + @searchValue + '%' or cardName like '%' + @searchValue + '%'
end 
else if @status = 'Open' begin
SELECT DISTINCT
convert(varchar,dbo.tblVoucher.[date],111) AS [Date],
dbo.tblVoucher.VoucherNo,
dbo.tblVoucher.cardID,
dbo.tblCardsProfile.cardName,
CONVERT(varchar, CAST(tblVoucher.AMOUNT-ISNULL(tblCVParticulars.APPLIEDVALUE,0) AS money), 1) as Amount,
dbo.tblVoucher.status
FROM
dbo.tblVoucher
LEFT JOIN dbo.tblCVParticulars ON dbo.tblCVParticulars.VoucherNo = dbo.tblVoucher.VoucherNo
INNER JOIN dbo.tblCardsProfile ON dbo.tblCardsProfile.cardID = dbo.tblVoucher.cardID
where [Date] like '%' + @searchValue + '%' and dbo.tblVoucher.status = 'Open' or tblVoucher.VoucherNo like '%' + @searchValue + '%' and dbo.tblVoucher.status = 'Open' or tblVoucher.cardID like '%' + @searchValue + '%' and dbo.tblVoucher.status = 'Open' or cardName like '%' + @searchValue + '%' and dbo.tblVoucher.status = 'Open'
end
END
GO


-- ----------------------------
-- procedure structure for GET_JO_HISTORY
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GET_JO_HISTORY]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[GET_JO_HISTORY]
GO

CREATE PROCEDURE [dbo].[GET_JO_HISTORY]
AS
BEGIN
SELECT [DATE],JONO,SALESNO,CUSTOMER,SUM(QTY) AS QTY,SUM(RELEASED) AS RELEASED,
CASE WHEN SUM(QTY)>SUM(RELEASED) THEN
'UNRELEASED'
ELSE
'RELEASED'
END
AS STATUS
FROM(SELECT
	dbo.tblJobOrder.[DATE],
	dbo.tblJobOrder.JONO,
	dbo.tblJobOrder.SALESNO,
	dbo.tblJobOrder.CUSTOMER,
	SUM ( dbo.tblJobOrderTR.QTY ) AS QTY,
	0 AS RELEASED 
FROM
	dbo.tblJobOrder
inner JOIN dbo.tblJobOrderTR ON dbo.tblJobOrder.JONO = dbo.tblJobOrderTR.JONO

GROUP BY
	dbo.tblJobOrder.JONO,
	dbo.tblJobOrder.[DATE],
	dbo.tblJobOrder.SALESNO,
	dbo.tblJobOrder.CUSTOMER 

	UNION ALL
	SELECT
	dbo.tblJobOrder.[DATE],
	dbo.tblJobOrder.JONO,
	dbo.tblJobOrder.SALESNO,
	dbo.tblJobOrder.CUSTOMER,
0 AS QTY,
	SUM ( dbo.tblOrderReleasedTR.RELEASED ) AS RELEASED 
FROM
	dbo.tblJobOrder
	RIGHT  JOIN dbo.tblOrderReleasedTR ON dbo.tblJobOrder.JONO = dbo.tblOrderReleasedTR.JONO 
GROUP BY
	dbo.tblJobOrder.JONO,
	dbo.tblJobOrder.[DATE],
	dbo.tblJobOrder.SALESNO,
	dbo.tblJobOrder.CUSTOMER ) AS SUBT
	 GROUP BY
	 [DATE],JONO,SALESNO,CUSTOMER
	 ORDER BY [date] desc
	
END
GO


