-- ----------------------------
-- procedure structure for GET_SALES_DATA
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GET_SALES_DATA]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[GET_SALES_DATA]
GO

CREATE PROCEDURE [dbo].[GET_SALES_DATA]
@command int,
@type varchar(255),
@transNo varchar(255)
AS
BEGIN
if @command = 0 begin
	if @type = 'QUOTATION' BEGIN
	SELECT
	S.QuoteNo,
	S.transDate,
	S.cardID,
	S.totalAmount,
	tr.itemNo,
	tr.Qty,
	tr.uPrice,
	tr.discount,
	tr.amount,
	S.userID,
	S.status,
	S.notimesedit,
	S.lastdateedit 
FROM
	tblSalesQuotation S
	INNER JOIN tblSalesItemsTR tr ON S.QuoteNo = tr.salesOrderNo
	WHERE  quoteNo = @TRANSNO
	END
	
	else if  @type = 'SALES ORDER' BEGIN
	SELECT
	S.salesOrderNo,
	S.transDate,
	S.cardID,
	S.totalAmount,
	tr.itemNo,
	tr.Qty,
	tr.uPrice,
	tr.discount,
	tr.amount,
	S.userID,
	S.status,
	S.notimesedit,
	S.lastdateedit 
FROM
	tblsalesOrder S
	INNER JOIN tblSalesItemsTR tr ON S.salesOrderNo = tr.salesOrderNo
	WHERE  s.salesOrderNo = @TRANSNO
	end
	else if  @type = 'SALES INVOICE' BEGIN
	
	SELECT
	S.salesInvoiceNo,
	S.transDate,
	S.cardID,
	S.totalAmount,
	tr.itemNo,
	tr.Qty,
	tr.uPrice,
	tr.discount,
	tr.amount,
	S.userID,
	S.status,
	S.notimesedit,
	S.lastdateedit 
FROM
	salesInvoice S
	INNER JOIN tblSalesItemsTR tr ON S.salesInvoiceNo = tr.salesOrderNo
	WHERE  salesInvoiceNo = @TRANSNO
	end
end
END
GO


