-- ----------------------------
-- procedure structure for insert_update_sales
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[insert_update_sales]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[insert_update_sales]
GO

CREATE PROCEDURE [dbo].[insert_update_sales]
@processCount int,
@salesMode varchar(255),
@salesno varchar(255),
@refNo varchar(255),
@cardID varchar(255),
@totalAmount decimal(20,2),
@userid varchar(255),
@status varchar(255),

@itemNo varchar(255),
@qty int,
@uprice decimal(20,2),
@amount decimal(20,2),
@discount decimal(20,2)


AS
BEGIN

if  @salesMode = 'QUOTATION' and @processCount = '0' BEGIN
INSERT INTO tblSalesQuotation values(@salesno,GETDATE(),@cardID,@totalAmount,@userid,@status,0,GETDATE())
end
else IF @salesMode = 'SALES ORDER' BEGIN
INSERT INTO tblSalesOrder values(@salesno,GETDATE(),@refNo,@cardID,@totalAmount,@userid,@status,0,GETDATE())
END
else IF @salesMode = 'SALES INVOICE' BEGIN
INSERT INTO tblSalesInvoice values(@salesno,GETDATE(),@refNo,@cardID,@totalAmount,@userid,@status,0,GETDATE())
END

INSERT INTO tblSalesItemsTR values(@salesno,@itemNo,@qty,@uprice,@discount,@amount)

end
GO


