IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[insert_update_payables]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[insert_update_payables]
GO

CREATE PROCEDURE [dbo].[insert_update_payables]
@command as varchar(255),
@refNo as varchar(255),
@src as varchar(255),
@payment as varchar(255),
@dueDate as datetime2,
@amount as decimal(20,2),
@status as varchar(255)
AS
BEGIN
if @command = 0 begin
insert into tblPayable values(@refno,@src,@payment,@duedate,@amount,@status)
end 
else if @command = 1 begin
update tblPayable set src = @src,payment = @payment,duedate = @duedate,amount = @amount,status = @status
end
END
GO


-- ----------------------------
-- procedure structure for insert_Purchase_Receiving
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[insert_Purchase_Receiving]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[insert_Purchase_Receiving]
GO

CREATE PROCEDURE [dbo].[insert_Purchase_Receiving]
@COMMAND AS int,
@AIR AS int,
  @TRANSNO AS varchar(255),
	@REFNO AS VARCHAR(255),
	@INVOICENO AS VARCHAR(255),
	@CARDID AS VARCHAR(255),
	@ITEMNO AS VARCHAR(255),
	@QTY AS INT,
	@UPRICE AS DECIMAL(20,2),
	@AMOUNT AS DECIMAL(20,2),
	@USERID AS VARCHAR(255),
	@STATUS AS VARCHAR(255)
AS
BEGIN
if @command = 0 begin
INSERT INTO tblPurchaseReceived VALUES(@TRANSNO,CONVERT(VARCHAR,GETDATE(),111),@REFNO,@INVOICENO,@CARDID,@ITEMNO,@QTY,@UPRICE,@AMOUNT,@USERID,@STATUS,0,CONVERT(VARCHAR,GETDATE(),111))
IF @AIR = 1 begin
update tblPurchaseOrder set status = 'Received' where purchaseOrderNo = @REFNO
end
ELSE if @AIR = 0 BEGIN
update tblPurchaseOrder set status = 'Received' where purchaseOrderNo = @REFNO AND itemNo = @ITEMNO
END
end
else if @command = 1 begin
update tblPurchaseReceived set invoiceNo = @invoiceno,cardID = @CARDID, ITEMNO = @ITEMNO, QTY = @QTY , UPRICE = @UPRICE , AMOUNT = @AMOUNT, USERID = @USERID, notimesedit = notimesedit + 1 , lastdateedit = CONVERT(VARCHAR,GETDATE(),111) 
where purchasereceivingNo = @TRANSNO
end
END
GO


-- ----------------------------
-- procedure structure for get_voucher_slip
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[get_voucher_slip]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[get_voucher_slip]
GO

CREATE PROCEDURE [dbo].[get_voucher_slip]
@transNo as varchar(255)
AS
BEGIN
SELECT
dbo.tblVoucher.VoucherNo,
dbo.tblVoucher.[date],
dbo.tblVoucher.cardID,
dbo.tblCardsProfile.cardname,
dbo.tblVoucher.remarks,
dbo.tblAccEntry.accNo,
dbo.tblCOA.accountName,
dbo.tblAccEntry.debit,
dbo.tblAccEntry.credit,
ISNULL(dbo.tblUsers.name, '')

FROM
dbo.tblAccEntry
INNER JOIN dbo.tblVoucher ON dbo.tblVoucher.VoucherNo = dbo.tblAccEntry.refNo
INNER JOIN dbo.tblCOA ON dbo.tblAccEntry.accNo = dbo.tblCOA.accNo AND dbo.tblCOA.accNo = dbo.tblAccEntry.accNo
left JOIN dbo.tblUsers ON dbo.tblVoucher.userid = dbo.tblUsers.userID
inner join dbo.tblCardsProfile on tblvoucher.cardid = tblCardsProfile.cardid

where dbo.tblVoucher.VoucherNo = @transNo
ORDER BY DEBIT DESC
END
GO


