-- ----------------------------
-- procedure structure for get_cash_requisition_list
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[get_cash_requisition_list]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[get_cash_requisition_list]
GO

CREATE PROCEDURE [dbo].[get_cash_requisition_list]
@command as varchar(255),
@searchValue as varchar(255)
AS
BEGIN if @command = 0 begin
select distinct convert(varchar,TRANSDATE,111) as DATE,CRSNO as No,tblCardsProfile.cardname as Cardname,totalamountapplied as Total_Amount,status as Status
from tblCashRequisition
inner join tblCardsProfile on tblCashRequisition.CARDID = tblCardsProfile.CARDID
where  CRSNO like '%' + @searchValue + '%' OR tblCashRequisition.CARDID like '%' + @searchValue + '%'
end
else if @command = 1 begin
select crsno,tblCardsProfile.cardid,cardname,cardAddress,totalamountapplied,particulars,amount,amountApplied,REMARKS
from tblCashRequisition
inner join tblCardsProfile on tblCashRequisition.CARDID = tblCardsProfile.CARDID
where  CRSNO like '%' + @searchValue + '%' OR tblCashRequisition.CARDID like '%' + @searchValue + '%'
end
else if @command = 2 begin
select crsno,transdate,tblCashRequisition.CARDID,tblCardsProfile.cardName,particulars,amount,amountApplied,remarks,TOTALAMOUNT,TOTALAMOUNTAPPLIED,notimesedit
from tblCashRequisition
inner join tblCardsProfile on tblCashRequisition.CARDID = tblCardsProfile.cardID
where CRSNO = @searchValue
end
END
GO


-- ----------------------------
-- procedure structure for get_cvno_fromCheckno
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[get_cvno_fromCheckno]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP PROCEDURE[dbo].[get_cvno_fromCheckno]
GO

CREATE PROCEDURE [dbo].[get_cvno_fromCheckno]
@command int,
@searchValue varchar(255)
AS
BEGIN
 if @command = 0 begin
SELECT
distinct
tblCheckVOUCHER.checkVoucherNo,CHECKNO
FROM
dbo.tblCheckVoucher
INNER JOIN dbo.tblAccEntry ON dbo.tblCheckVoucher.checkVoucherNo = dbo.tblAccEntry.refno
INNER JOIN dbo.tblCardsProfile ON dbo.tblCheckVoucher.cardID = dbo.tblCardsProfile.cardID
left JOIN dbo.tblCheckTransaction ON dbo.tblCheckVoucher.checkVoucherNo = dbo.tblCheckTransaction.[NO] 
INNER  JOIN tblCheckbook ON tblCheckTransaction.CHECKBOOKID = tblCheckbook.checkbookID
INNER JOIN tblBank on tblCheckbook.bankID = tblBank.bankID
inner join tblCOA on tblAccEntry.accno = tblcoa.accno
where tblCheckVOUCHER.CheckVoucherNo like '%'+ @searchvalue + '%'
end 
END
GO


